import React from 'react';
import './CategoryCard.css';

const CategoryCard = ({ category, onSelect }) => {
  return (
    <div className={`card ${category.code}`} onClick={() => onSelect(category)}>
      <h3>{category.name}</h3>
    </div>
  );
};

export default CategoryCard;
